import React from 'react';

class Header extends React.Component {
    render() {
        return (
            <Header className="top">
                <h1>Catch of the day</h1>
                <h3 className="tagline">
                    <span>Fresh Fish Market</span>
                </h3>
            </Header>

        )
    }
}

export default Header;
